import React from 'react';
import './style.css';

class Search extends React.Component {

  handleChange(){
    console.log("change")
  }
  render() {
    return (
      <div className="search">
        <input onChange={() => this.handleChange()} class="inputSearch" type="text" placeholder="Buscar..."></input>
      </div>
    );
  }
}

export default Search;
